import React from 'react'
import { View, Text, StyleSheet } from 'react-native'
import { FlatList } from 'react-native-gesture-handler'

const ListScreen = () => {

    const friends = [
        { name: 'Friend #1', key: '1' },
        { name: 'Friend #2', key: '2' },
        { name: 'Friend #3', key: '3' },
        { name: 'Friend #4', key: '4' },
        { name: 'Friend #5', key: '5'},
        { name: 'Friend #6', key: '6' },
        { name: 'Friend #7', key: '7' },
        { name: 'Friend #8', key: '8' },
        { name: 'Friend #9', key: '9' },
    ]

    return (
        <FlatList
            data={friends}
            renderItem={({item}) => {
                return <Text>{item.name}</Text>
            }} 
        />
    )
}


export default ListScreen
